import React from 'react';
import {Card, Header}  from "./Component/Card";
import Showdata from "./Component/Sdata"
import './App.css';

const App = () => {
  return (
    <div>

     <Header />
     {Showdata.map((val) => { 
       return (
      <Card
       key={val.id}
       imgsrc={val.imgsrc}
       title={val.title}
       showname={val.showname}
       links={val.links}
       />
       )
       })}

    </div>
  )
}

